import React, { useState } from 'react';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import { styled, alpha } from '@mui/material/styles';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import InputBase from '@mui/material/InputBase';
import { Button, Menu, MenuItem, Stack } from '@mui/material';
import logo from '../assets/techcareer-logo.svg';
import useMediaQuery from '@mui/material/useMediaQuery';

const Search = styled('div')(({ theme }) => ({
  position: 'relative',
  borderRadius: theme.shape.borderRadius,
  backgroundColor: alpha(theme.palette.common.black, 0.15),
  '&:hover': {
    backgroundColor: alpha(theme.palette.common.black, 0.25),
  },
  marginRight: theme.spacing(2),
  marginLeft: theme.spacing(2),
  width: 'auto',
}));

const SearchIconWrapper = styled('div')(({ theme }) => ({
  padding: theme.spacing(0, 2),
  height: '100%',
  position: 'absolute',
  pointerEvents: 'none',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
  color: 'inherit',
  '& .MuiInputBase-input': {
    padding: theme.spacing(1, 1, 1, 0),
    paddingLeft: `calc(1em + ${theme.spacing(4)})`,
    width: '100%',
    transition: theme.transitions.create('width'),
  },
}));

export default function PrimarySearchAppBar() {
  const [anchorEl, setAnchorEl] = useState(null);
  const isMobile = useMediaQuery('(max-width:768px)');

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" sx={{ backgroundColor: 'white' }}>
        <Toolbar>
          {/* Logo */}
          <Box sx={{ display: 'flex', alignItems: 'center', flexGrow: 1 }}>
            <a href="../Pages/Home">
              <img src={logo} alt="logo" width="200px" height="25px" />
            </a>
          </Box>

          {/* Arama çubuğu */}
          <Search sx={{ display: { xs: 'none', sm: 'flex' } }}>
            <SearchIconWrapper>
              <SearchIcon />
            </SearchIconWrapper>
            <StyledInputBase
              placeholder="Etkinlik, İş ilanı, Blog ara"
              inputProps={{ 'aria-label': 'search' }}
            />
          </Search>

          {/* Butonlar - Mobilde tek bir menü ikonu */}
          {isMobile ? (
            <>
              <IconButton
                size="large"
                edge="end"
                color="inherit"
                aria-label="menu"
                onClick={handleMenuOpen}
                sx={{ display: { xs: 'flex', md: 'none' }, color: 'black' }} // Menü ikonu sadece mobilde görünür
              >
                <MenuIcon />
              </IconButton>
              <Menu
                anchorEl={anchorEl}
                open={Boolean(anchorEl)}
                onClose={handleMenuClose}
                anchorOrigin={{
                  vertical: 'top',
                  horizontal: 'right',
                }}
                transformOrigin={{
                  vertical: 'top',
                  horizontal: 'right',
                }}
              >
                <MenuItem onClick={handleMenuClose}>Buton 1</MenuItem>
                <MenuItem onClick={handleMenuClose}>Buton 2</MenuItem>
                <MenuItem onClick={handleMenuClose}>Buton 3</MenuItem>
                <MenuItem onClick={handleMenuClose}>
                  <Button variant="outlined" sx={{ color: 'black' }}>
                    Giriş/Üye
                  </Button>
                </MenuItem>
              </Menu>
            </>
          ) : (
            <Stack spacing={2} direction="row" sx={{ mr: 8 }}>
              <Button variant="text" sx={{ color: 'black' }}>Buton 1</Button>
              <Button variant="text" sx={{ color: 'black' }}>Buton 2</Button>
              <Button variant="text" sx={{ color: 'black' }}>Buton 3</Button>
              <Button variant="outlined" sx={{ color: 'black' }}>Giriş/Üye</Button>
            </Stack>
          )}
        </Toolbar>
      </AppBar>
    </Box>
  );
}
